import { useEffect, useState } from "react";
import { Navigate, useParams } from "react-router-dom";


function Home(params) {

    const token = localStorage.getItem('access_token');
    const [homes, setHomes] = useState([]);
    const { homenum } = useParams();
    useEffect(() => {
        if (token) {
            fetch(params.url + "homes/"+homenum, {
                method: "GET",
                headers: {
                    Authorization: token
                }
            }).then(res => res.json()).then(res => {
                // console.log(res);
                setHomes(res);
            })
        }
    },[params.url, token])



    if (!token) {
        return (
            <Navigate to='login'/>
        )
    }


    return (
        <div>
            <h1>Available Homes</h1>
            {homes.map((item, i) => {
                console.log(item.name);
                return (<p><a href={item.id} key={item.id}>{item.name}</a></p>)
            })}
        </div>
    );
}

export default Home;
